import React from 'react'

const Product = ({item}) => {
  return (
    <div>
      <h3>{item.title}</h3>
      <img src={item.image} alt="" />
      <p>{item.description}</p>
      <p>{item.cate}</p>
    </div>
  )
}

export default Product
